import React from "react";

import "../styles/Pop.scss";

const Pop = () => {

    const odd = {
        position: 'absolute',
        top: '50%',
        right: Math.floor(Math.random() * 30) + '%',
        // bottom: Math.floor(Math.random() * 30) + '%'
    }

    const even = {
        position: 'absolute',
        left: Math.floor(Math.random() * 30) + '%',
        top: Math.floor(Math.random() * 30) + '%',
    }

    const users = {
        "users": [
            {
                "id": 1,
                "first_name": "Robert",
                "last_name": "Schwartz",
                "email": "rob23@gmail.com"
            },
            {
                "id": 2,
                "first_name": "Lucy",
                "last_name": "Ballmer",
                "email": "lucyb56@gmail.com"
            },
            {
                "id": 3,
                "first_name": "Anna",
                "last_name": "Smith",
                "email": "annasmith23@gmail.com"
            },
            {
                "id": 4,
                "first_name": "Robert",
                "last_name": "Brown",
                "email": "bobbrown432@yahoo.com"
            },
            {
                "id": 5,
                "first_name": "Roger",
                "last_name": "Bacon",
                "email": "rogerbacon12@yahoo.com"
            }
        ]
    }


    const listed = Object.keys({users}).map(function (key, value) {
        console.log(users[value]);
        return <p data-tooltip={value} style={(key % 2 === 0) ? even : odd} ></p>;
    });

    return [
        <div className='action'>
            {listed}
        </div>
    ];
}

export default Pop;
